import React from 'react';
import img1 from './head-img1.jpg';
import './Head.css';

const Navbar = () => {
    return (
        <div className='head'>
            {/* <div className="head-img">
                <img src={img1}  alt="" />
            </div> */}
            <div class="flex justify-center">
  <div
    class="block max-w- bg-white shadow-lg dark:bg-neutral-700">
    
      <img
        class="rounded"
        src={img1}
        alt="" />
    
    
  </div>
</div>
        </div>
        
    )
    
}

export default Navbar
